import React, { Component } from 'react';
import ListProjectComponent from "./ListProjectComponent";
import AuthenticationService from "./AuthenticationService";
import jwt_decode from "jwt-decode";
import {BrowserRouter as Router, withRouter} from 'react-router-dom';
import Switch from "react-router-dom/es/Switch";
import Route from "react-router-dom/es/Route";
import StudentProfileManagerComponent from "./StudentProfileManagerComponent";
import StudentTopNav from "./StudentTopNav";
import StudentRatingComponent from "./StudentRatingComponent";
import TopNavBar from "./TopNavBar";

class StudentPage extends Component{
    constructor(props) {
        super(props);
        const user = AuthenticationService.getCurrentUser();

        if (user) {
            const decode = jwt_decode(user.token)
            const role = decode.role
            if (role === "company") {
                props.history.push("/company")
            }
        } else {
            props.history.push("/login")
        }
        this.router = this.router.bind(this)

    }

    router(url) {
        this.props.history.push(url)
        console.log(this.props.history)
    }

    render() {

        return (
            <div className="App">
                <TopNavBar router={this.router}/>
                <Router>
                    <>
                        <Switch>
                            <Route path="/student/profile/"  component={StudentProfileManagerComponent} />
                            <Route path="/student/projects/" component={ListProjectComponent} />
                            <Route path="/student/rating/" component={StudentRatingComponent} />
                        </Switch>
                    </>
                </Router>

            </div>
        )
    }
}

export default withRouter(StudentPage);
